'''Benny Gutenberg'''{{CiteNPC|npc=Benny|quote=[The Varrock Herald] is edited, printed and published by myself, Benny Gutenberg.|loc=}} is the [[newspaper]] seller in [[Varrock Square]]. He can be found near [[Baraek]]'s [[fur stall]]. He carries a backpack full of newspapers on his back and sells newspapers for {{NoCoins|50}} [[coins]] each. Buying one from him is required for the [[Easy Varrock Diary]].

